import { NavigationContainer } from "@react-navigation/native";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import React, { Component } from "react";
import { Text, StyleSheet, View } from "react-native";
import AllergyOptions from "./AllergyOptions";
import CuisineOptions from "./CuisineOptions";
import DietTypes from "./DietTypes";

const MaterialTopTabs = createMaterialTopTabNavigator();

createTopTabs = () => {
  return (
    <MaterialTopTabs.Navigator>
      <MaterialTopTabs.Screen name="Tab1" component={AllergyOptions} />
      <MaterialTopTabs.Screen name="Tab2" component={CuisineOptions} />
      <MaterialTopTabs.Screen name="Tab3" component={DietTypes} />
    </MaterialTopTabs.Navigator>
  );
};

export default class FlavourProfile extends Component {
  render() {
    return (
      <View>
        <NavigationContainer>{this.createTopTabs()}</NavigationContainer>
      </View>
    );
  }
}

const styles = StyleSheet.create({});
